import { ThemeProvider, CSSReset } from "@chakra-ui/core";
export default function Index() {
  return (
    <ThemeProvider>
      <CSSReset />
      <div>
        <h2>Xkcd Search</h2>
      </div>
    </ThemeProvider>
  );
}
